rule "MetricBeat-50-NetworkDataIncrementsOut"
when
  has_field("network_interface_name") &&
  has_field("network_interface_bytes_tx") &&
  to_long($message.network_interface_bytes_tx) > 0
then
    let key = concat(to_string($message.source), concat("-", concat(to_string($message.network_interface_name), "-BYTESOUT")));
    let prev_bytes = to_long(lookup_value("metricbeat-fix", key, 0));
    let curr_bytes = to_long($message.network_interface_bytes_tx);
    let diff_bytes = curr_bytes - prev_bytes;
    lookup_set_value("metricbeat-fix", key, $message.network_interface_bytes_tx);
    set_field("network_interface_bytes_tx", diff_bytes);
end

